import Firstpage from './Firstpage'
import Postview from './Postview';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  BrowserRouter
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Firstpage />
      <div>
        <Link to='/'>Enter</Link>
      </div>
      <Routes>
        <Route path='/' element={<Postview />}></Route>
      </Routes>

    </Router>




  )
};

export default App;
